Unfortunately, there is no built-in support for socks proxies in the .NET Standard libraries. You can use an external NuGet package: HttpToSocks5Proxy provided by one of our team members. // using MihaZupan; var proxy = new HttpToSocks5Proxy(Socks5ServerAddress, Socks5ServerPort); // Or if you need credentials for your proxy server:
var proxy = new HttpToSocks5Proxy( Socks5ServerAddress, Socks5ServerPort, "USERNAME", "PASSWORD"
); // Allows you to use proxies that are only allowing connections to Telegram
// Needed for some proxies
proxy.ResolveHostnamesLocally = true; var botClient = new TelegramBotClient("YOUR_API_TOKEN", proxy); You can see other usages of this package at HttpToSocks5Proxy 's readme .

