Warning: Use for Testing only! Do not use this method in a production deployment as it has high network latency and poor bandwidth. Using proxy with Tor, a developer can avoid network restrictions while debugging and testing the code before a production release. Install Tor Browser Open the torcc file with a text editor (Found in Tor Browser\Browser\TorBrowser\Data\Tor ) Add the following lines: (configurations are described below) EntryNodes {NL}
ExitNodes {NL}
StrictNodes 1
SocksPort 127.0.0.1:9050 Look at the Socks5 proxy example above. Start the Tor Browser Usage: // using MihaZupan; var botClient = new TelegramBotClient( "YOUR_API_TOKEN", new HttpToSocks5Proxy("127.0.0.1", 9050)
); Note that Tor has to be active at all times for the bot to work.

