StrictNodes 1 These three lines make sure you use nodes from the Netherlands as much as possible to reduce latency. SocksPort 127.0.0.1:9050 This line tells tor to listen on port 9050 for any socks connections. You can change the port to anything you want (9050 is just the default), just make sure to use the same port in your code.
